import '../CSS/Menu.css';
import MenuItem from './MenuItem';

function Menu(props) {
     const database = props.database;

     function displayMenu() {
          database.map((item, i) => {
               return <div key={i + 1}>{MenuItem(item)}</div>;
          });
     }

     return <div className='menu_list'>{MenuItem(displayMenu())}</div>;
}

export default Menu;
